import React, { useState } from "react";

export default function App() {
 const [state, setState] = useState;
  return (
    <div className="App">
      <Todos value={state} setState={setState}/>
    </div>
  );
}

const Todos = ({value}) =>{
  const[state, setState] = useState;

  const counting = (state)=>{
    state += state.value
  }

  return(
    <>
      <button value={state} onclick={counting}>0</button>
    </>
  );
};
